export default function PersonalSkills(langague: string) {
    const json = {
        'pt-br': {
            componentLabel: 'Habilidades', 
        },
        'en': {
            componentLabel: 'Skills',
        }
    };

        if (langague == 'eng') {
            return json['en'];
        }
        return json['pt-br'];
};
